const CountryInfo = () => {
    return ( 
        <div className=" p-6 py-8 md:px-14 md:p-12">
            <button className="text-black border inline-flex items-center py-2 px-4 rounded border-slate-200 shadow-md">
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="15" height="15"><path fill="none" d="M0 0h24v24H0z"/><path d="M7.828 11H20v2H7.828l5.364 5.364-1.414 1.414L4 12l7.778-7.778 1.414 1.414z"/>
            </svg>
            <div className="px-3">Back</div>
            </button>

        <div className="flex flex-row m-6">
        <div className="md:flex md:basis-1/2">
            taye
        </div>
        <div className="md:flex md:basis-1/2">
            kehinde
        </div>
        </div>

        </div>
     );
}
 
export default CountryInfo;
